BEGIN TRANSACTION;
CREATE TABLE activities (
	id INTEGER NOT NULL, 
	user_id INTEGER, 
	activity_id BIGINT, 
	activity_name VARCHAR(255), 
	activity_type VARCHAR(50), 
	start_time VARCHAR(50), 
	distance_meters FLOAT, 
	duration_seconds FLOAT, 
	average_speed FLOAT, 
	max_speed FLOAT, 
	calories INTEGER, 
	average_hr FLOAT, 
	max_hr INTEGER, 
	elevation_gain FLOAT, 
	elevation_loss FLOAT, 
	start_latitude FLOAT, 
	start_longitude FLOAT, 
	device_name VARCHAR(100), 
	created_timestamp VARCHAR(50), 
	steps INTEGER, 
	average_running_cadence FLOAT, 
	max_running_cadence FLOAT, 
	stride_length FLOAT, 
	vo2max_estime FLOAT, 
	training_load FLOAT, 
	aerobic_effect FLOAT, 
	anaerobic_effect FLOAT, 
	temp_min FLOAT, 
	temp_max FLOAT, 
	fastest_split_5000 FLOAT, 
	fastest_split_10000 FLOAT, 
	hr_zone_1 FLOAT, 
	hr_zone_2 FLOAT, 
	hr_zone_3 FLOAT, 
	hr_zone_4 FLOAT, 
	hr_zone_5 FLOAT, 
	PRIMARY KEY (id), 
	FOREIGN KEY(user_id) REFERENCES users (user_id), 
	UNIQUE (activity_id)
);
CREATE TABLE gps_data (
	id INTEGER NOT NULL, 
	activity_id INTEGER, 
	latitude FLOAT, 
	longitude FLOAT, 
	timestamp DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(activity_id) REFERENCES activities (id)
);
CREATE TABLE metrics (
	metrics_id INTEGER NOT NULL, 
	user_id INTEGER, 
	date_calcul VARCHAR(50), 
	vma_kmh FLOAT, 
	vo2max_estime FLOAT, 
	zone_fc TEXT, 
	charge_7j FLOAT, 
	charge_28j FLOAT, 
	forme FLOAT, 
	fatigue FLOAT, 
	tendance_progression VARCHAR(50), 
	ratio_endurance FLOAT, 
	prediction_10k_min FLOAT, 
	recommandation_jour TEXT, 
	PRIMARY KEY (metrics_id), 
	FOREIGN KEY(user_id) REFERENCES users (user_id)
);
CREATE TABLE users (
	user_id INTEGER NOT NULL, 
	nom VARCHAR(100), 
	prenom VARCHAR(100), 
	age INTEGER, 
	sexe VARCHAR(10), 
	taille_cm INTEGER, 
	poids_kg FLOAT, 
	niveau VARCHAR(50), 
	objectif_type VARCHAR(50), 
	objectif_temps VARCHAR(50), 
	disponibilite TEXT, 
	blessures TEXT, 
	terrain_prefere VARCHAR(20), 
	frequence_semaine INTEGER, 
	PRIMARY KEY (user_id)
);
COMMIT;
